INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'deDE', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'deDE', 'Kitzelt die folgenden Mittlerratten in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Schabernack!', '', 42010),
(15179, 'deDE', 'Besiegt Hylbrand in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr nur Umgehungscodes eingegeben habt, während Ihr mit \'Sterilisierendes Feld\' belegt wart.', 'Alles entspannt', '', 42010),
(15178, 'deDE', 'Besiegt So\'leah in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr bei der Verwendung gefälschter Legitimation erwischt wurdet.', 'Gut gefälscht ist halb gewonnen', 'Reittierbelohnung: Gleitscheibe von Tazavesh', 42010),
(15177, 'deDE', 'Besiegt So\'leah in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Tazavesh, der Verhüllte Markt', '', 42010),
(15109, 'deDE', 'Besiegt Zo\'phex den Wächter in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\', während Ihr mit 4 unterschiedlichen zerkleinerten Substanzen überzogen seid.', 'Universalzerkleinerer', '', 42010),
(15106, 'deDE', 'Besiegt den P.O.S.T.-Meister in Tazavesh, dem Verhüllten Markt, auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr alle instabilen Waren vor der Zustellung an mindestens einen weiteren Spielercharakter weitergegeben habt.', 'Qualitätskontrolle', '', 42010),
(14607, 'deDE', 'Bezwingt Bluthack im Theater der Schmerzen auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr 2 Fleischbrocken mit \'Weichklopfendes Schmettern\' weichgeklopft habt.', 'Frischfleisch!', '', 42010),
(14606, 'deDE', 'Bezwingt Händlerin Xy\'exa auf der Andren Seite auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr alle 5 Kugeln eingesammelt habt, die über ihr schweben.', 'Alle Fünfe!', '', 42010),
(14567, 'deDE', 'Bezwingt Halkias in den Hallen der Sühne auf dem Schwierigkeitsgrad \'Mythisch\', nachdem er alle drei Splitter von Halkias wieder absorbiert hat.', 'Stückwerk', '', 42010),
(14533, 'deDE', 'Bezwingt Mordretha, die Unendliche Kaiserin, im Theater der Schmerzen auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr /herausfordern ausgeführt und 2 geisterhafte Anwärter besiegt habt.', 'Kaiserliche Keilerei', '', 42010),
(14503, 'deDE', 'Bezwingt Ingra Maloch in den Nebeln von Tirna Scithe auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr eine überwucherte Hydra besiegt habt.', 'Hydrakultur', '', 42010),
(14417, 'deDE', 'Besiegt Mordretha, die Unendliche Kaiserin, im Theater der Schmerzen auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Das Theater der Schmerzen', '', 42010),
(14416, 'deDE', 'Besiegt Mordretha, die Unendliche Kaiserin, im Theater der Schmerzen auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Das Theater der Schmerzen', '', 42010),
(14415, 'deDE', 'Besiegt Markgräfin Stradama in Seuchensturz auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Seuchensturz', '', 42010),
(14414, 'deDE', 'Besiegt Markgräfin Stradama in Seuchensturz auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Seuchensturz', '', 42010),
(14413, 'deDE', 'Besiegt Tred\'ova in den Nebeln von Tirna Scithe auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Die Nebel von Tirna Scithe', '', 42010),
(14412, 'deDE', 'Besiegt Tred\'ova in den Nebeln von Tirna Scithe auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Die Nebel von Tirna Scithe', '', 42010),
(14411, 'deDE', 'Besiegt den Obersten Kämmerer in den Hallen der Sühne auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Hallen der Sühne', '', 42010),
(14410, 'deDE', 'Besiegt den Obersten Kämmerer in den Hallen der Sühne auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Hallen der Sühne', '', 42010),
(14409, 'deDE', 'Besiegt Mueh\'zala auf der Andren Seite auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Die Andre Seite', '', 42010),
(14408, 'deDE', 'Besiegt Mueh\'zala auf der Andren Seite auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Die Andre Seite', '', 42010),
(14375, 'deDE', 'Bezwingt Tred\'ova in den Nebeln von Tirna Scithe auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr einen erleuchteten Stachelschlundfresser besiegt habt.', 'Wissenshunger', '', 42010),
(14374, 'deDE', 'Sorgt dafür, dass Millhaus und Millificent sich mit jedem Wirken von \'Schattenfuror\' und \'Fingerlaser Echo X-trem\' gegenseitig treffen, und bezwingt die Manasturms auf der Andren Seite auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Paartherapie', '', 42010),
(14373, 'deDE', 'Besiegt Mueh\'zala auf der Andren Seite.', 'Die Andre Seite', '', 42010),
(14372, 'deDE', 'Besiegt Mordretha, die Unendliche Kaiserin, im Theater der Schmerzen.', 'Theater der Schmerzen', '', 42010),
(14371, 'deDE', 'Besiegt Tred\'ova in den Nebeln von Tirna Scithe.', 'Nebel von Tirna Scithe', '', 42010),
(14370, 'deDE', 'Besiegt den Obersten Kämmerer in den Hallen der Sühne.', 'Hallen der Sühne', '', 42010),
(14369, 'deDE', 'Besiegt Markgräfin Stradama in Seuchensturz.', 'Seuchensturz', '', 42010),
(14368, 'deDE', 'Besiegt Nalthor den Eisbinder in der Nekrotischen Schneise auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Die Nekrotische Schneise', '', 42010),
(14367, 'deDE', 'Besiegt Nalthor den Eisbinder in der Nekrotischen Schneise auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Die Nekrotische Schneise', '', 42010),
(14354, 'deDE', 'Besiegt Hakkar, die Manasturms, Händlerin Xy\'exa und Mueh\'zala in einem einzelnen Besuch auf der Andren Seite auf dem Schwierigkeitsgrad \'Mythisch\', während mindestens ein Gruppenmitglied von \'Verderbtes Blut\' betroffen ist.', 'Hochansteckend', '', 42010),
(14352, 'deDE', 'Besiegt den Obersten Kämmerer in den Hallen der Sühne auf dem Schwierigkeitsgrad \'Mythisch\' mit 3 Sündensteinstatuen in den Ecken des Raums.', 'Eckenschützen', '', 42010),
(14347, 'deDE', 'Besiegt Globgrog in Seuchensturz auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr ihm ein Mahl mit drei Gängen verfüttert habt.', 'Gibt es Nachschlag?', '', 42010),
(14331, 'deDE', 'Bezwingt Oryphrion in den Spitzen des Aufstiegs auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr alle drei zerschmetterten Verwüster aktiviert und zerstört habt.', 'Goliath offline', '', 42010),
(14327, 'deDE', 'Sammelt in den Spitzen des Aufstiegs auf dem Schwierigkeitsgrad \'Mythisch\' alle fünf Kugeln im Abstand von jeweils maximal 60 Sekunden, nachdem Ihr Devos, Paragon des Zweifels, bezwungen habt.', 'Ich kann mein Haus von hier aus sehen', '', 42010),
(14326, 'deDE', 'Bezwingt Devos, Paragon des Zweifels, in den Spitzen des Aufstiegs.', 'Spitzen des Aufstiegs', '', 42010),
(14325, 'deDE', 'Bezwingt Devos, Paragon des Zweifels, in den Spitzen des Aufstiegs auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Spitzen des Aufstiegs', '', 42010),
(14324, 'deDE', 'Bezwingt Devos, Paragon des Zweifels, in den Spitzen des Aufstiegs auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Spitzen des Aufstiegs', '', 42010),
(14323, 'deDE', 'Bezwingt Devos, Paragon des Zweifels, in den Spitzen des Aufstiegs auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr sie mit fünf Speeren der Pflicht getroffen habt.', 'ExSPEERte', '', 42010),
(14320, 'deDE', 'Bezwingt Chirurg Fleischnaht in der Nekrotischen Schneise auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr zwei Fässer voller Ersatzteile zerstört habt.', 'Vorräte des Chirurgen', '', 42010),
(14297, 'deDE', 'Besiegt auf dem Schwierigkeitsgrad \'Mythisch\' in mehreren Durchläufen des Affronts des Herausforderers im Theater der Schmerzen jeden der Kämpfer als letzten.', 'Totes Trio', '', 42010),
(14296, 'deDE', 'Besiegt Doktor Ickus in Seuchensturz auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr 2 instabile Seuchenbomben zerstört habt.', 'Virale Vernichtung', '', 42010),
(14295, 'deDE', 'Bezwingt Amarth den Ernter in der Nekrotischen Schneise auf dem Schwierigkeitsgrad \'Mythisch\', nachdem er mit \'Letzte Ernte\' die Leiche eines grausigen Kolosses verschlungen hat.', 'Reiche Ernte', '', 42010),
(14292, 'deDE', 'Bezwingt alle Bosse in einem einzelnen Besuch in Seuchensturz auf dem Schwierigkeitsgrad \'Mythisch\', während der Effekt \'Seuchensturz\' aktiv ist.', 'Schleimiger Ritt', '', 42010),
(14291, 'deDE', 'Findet Nebelruferins 6 Spielzeuge in den Nebeln von Tirna Scithe auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Darüber könnte jemand stolpern!', '', 42010),
(14290, 'deDE', 'Bezwingt Duraka den Unverwüstlichen in den Blutigen Tiefen auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Ich habe nur Augen für Euch', '', 42010),
(14289, 'deDE', 'Bezwingt Generalin Kaal in den Blutigen Tiefen auf dem Schwierigkeitsgrad \'Mythisch\', während der Effekt \'Schmetterschlag!\' aktiv ist.', 'Kaalschlag', '', 42010),
(14286, 'deDE', 'Besiegt Henker Tarvold in den Blutigen Tiefen auf dem Schwierigkeitsgrad \'Mythisch\', nachdem Ihr 8 trostlose Gefangene mit dem Effekt \'Rückstände\' getötet habt.', 'Rückstände des Bösen', '', 42010),
(14285, 'deDE', 'Besiegt Nalthor den Eisbinder in der Nekrotischen Schneise auf dem Schwierigkeitsgrad \'Mythisch\', ohne von \'Kometenhagel\', \'Blizzard\' oder dem Sekundäreffekt von \'Frostige Fesseln\' getroffen zu werden.', 'Allzeit schlachtzugsbereit VII', '', 42010),
(14284, 'deDE', 'Zertrümmert mindestens 18 unsterbliche Steinscheusale gleichzeitig und besiegt danach Echelon in den Hallen der Sühne auf dem Schwierigkeitsgrad \'Mythisch\'.', 'Randale im Saale', '', 42010),
(14199, 'deDE', 'Bezwingt Generalin Kaal in den Blutigen Tiefen auf dem Schwierigkeitsgrad \'Mythisch\' oder \'Mythischer Schlüsselstein\'.', 'Mythisch: Die Blutigen Tiefen', '', 42010),
(14198, 'deDE', 'Bezwingt Generalin Kaal in den Blutigen Tiefen auf dem Schwierigkeitsgrad \'Heroisch\' oder höher.', 'Heroisch: Die Blutigen Tiefen', '', 42010),
(14197, 'deDE', 'Bezwingt Generalin Kaal in den Blutigen Tiefen.', 'Die Blutigen Tiefen', '', 42010),
(15395, 'deDE', '', 'Fae\'s Giving [DNT]', '', 42010),
(13930, 'deDE', 'Verdient 200 Zeitverzerrte Abzeichen durch Teilnahme und Quests im klassischen Alteractal.', 'Das Alte-ractal', 'Belohnung: Frostwolfknurrer', 42010),
(13928, 'deDE', 'Verdient 200 Zeitverzerrte Abzeichen durch Teilnahme und Quests im klassischen Alteractal.', 'Das Alte-ractal', 'Belohnung: Kampfwidder der Sturmlanzen', 42010),
(15388, 'deDE', 'Erkundet die Regionen der Schattenlande.', 'Erforscher der Schattenlande', '', 42010),
(14825, 'deDE', 'Schließt die unten aufgelisteten Erfolge in den Schattenlanden ab.', 'Reisender der Schattenlande', '', 42010),
(14802, 'deDE', 'Besiegt alle sieben Champions im Theater der Schmerzen.', 'Blutsport', '', 42010),
(14791, 'deDE', 'Werft Gwynceirw, dem Winterwolf, während oder nach dem Kampf gegen den Morastboggart einen schwach leuchtenden Samen zu.', 'Reichet Samen Eurem Jäger...', '', 42010),
(14788, 'deDE', 'Beschafft die folgenden verlorenen Bücher im Ardenwald wieder.', 'Fragmentarische Feengeschichten', '', 42010),
(14779, 'deDE', 'Tötet die folgenden Wildtiere des Ardenwalds:', 'Wilde Jagd', '', 42010),
(14774, 'deDE', 'Probiert alle köstlichen Delikatessen des Ardenwalds.', 'Gourmand des Ardenwalds', '', 42010),
(14771, 'deDE', 'Fahrt in Revendreth mit jeder der folgenden Kutschen.', 'Der Jenseitsexpress', '', 42010),
(14770, 'deDE', 'Mietet Schlosssündenmähren für Ritte zu folgenden Orten in Revendreth.', 'Der sündige Reiter', '', 42010),
(14769, 'deDE', 'Benutzt durchflutete Rubine, um alle Fleddermausstatuen in Revendreth zu animieren.', 'Animateur', '', 42010),
(14768, 'deDE', 'Steht in jedem der unten aufgelisteten Tempel der Bastion unter dem Einfluss jeder Hymne.', 'Was ist das für eine Melodie?', '', 42010),
(14767, 'deDE', 'Steht in der Bastion unter dem Einfluss aller unten aufgelisteten geläuterter Segen.', 'Gänzlich Gesegnet', '', 42010),
(14763, 'deDE', 'Sammelt alle Anpassungsoptionen für die Verkleidung des nekrotischen Akolythen in Maldraxxus ein.', 'Krypta Couture', 'Belohnung: Maske des Seuchenarzts', 42010),
(14734, 'deDE', 'Läutet alle fünf Tempelvesperglocken in der Bastion, um den Rat der Aufgestiegenen zusammenzurufen.', 'Schlachtruf der Aufgestiegenen', '', 42010),
(14733, 'deDE', 'Überlebt Sonnentänzers Zorn und verdient Euch das Privileg, ihn nach dem Recht des Stärkeren herauszufordern.', 'Heißes Rodeo', '', 42010),
(14731, 'deDE', 'Die Tiere der Schattenlande wurden zwar schon geliebt, brauchen aber noch etwas mehr /Liebe.', 'Ob groß, ob klein, nur durch Liebe kann ein Tierchen glücklich sein', '', 42010),
(14721, 'deDE', 'Besiegt alle sieben Schöpfungen aus dem Reservoir der gemischten Monstrositäten.', 'Die Mischung macht\'s', 'Belohnung: Stinkender Glibber', 42010),
(14634, 'deDE', 'Findet und streichelt alle Kätzchen in Maldraxxus.', 'Neun jenseitige Leben', 'Belohnung: Jiggles\' Lieblingsspielzeug', 42010),
(14626, 'deDE', 'Erhaltet Kummerfluch vom Theater der Schmerzen.', 'Ernter der Trauer', '', 42010),
(14353, 'deDE', 'Nehmt an den folgenden Aufführungen im Sternseeamphitheater teil:', 'Der Ardenwald ist eine Bühne', '', 42010),
(14339, 'deDE', 'Findet alle verlorenen Animakristallsplitter in der Bastion.', 'Splitterpartie', '', 42010),
(14277, 'deDE', 'Schließt die unten aufgelisteten Erfolge in Revendreth ab.', 'Eingeschworene der Anklägerin', 'Bonustitel: Grufthüter(in)', 42010),
(14276, 'deDE', 'Besiegt die folgenden Inquisitoren in Revendreth.', 'Revendreth ist sündhaft schön', '', 42010),
(14274, 'deDE', 'Helft 100 flüchtigen Seelen, ein Ritual der Absolution in Revendreth durchzuführen.', 'Absolution für alle', '', 42010),
(14273, 'deDE', 'Öffnet 50 Sühnengruften in Revendreth.', 'Grufttreter', '', 42010),
(14272, 'deDE', 'Verdient Euch die Freundschaft von Steinkopf in Revendreth.', 'Beste Kumpels mit gewissen Vorzügen', '', 42010),
(5854, 'deDE', 'Nutzt Euer Winterhauchgesangsbuch, um während des Winterhauchfests in den feindlichen Hauptstädten ein festliches Lied anzustimmen.', 'Süßer die Feinde nie klingen', '', 42010),
(5853, 'deDE', 'Nutzt Euer Winterhauchgesangsbuch, um während des Winterhauchfests in den feindlichen Hauptstädten ein festliches Lied anzustimmen.', 'Süßer die Feinde nie klingen', '', 42010);
