(15190, 'esES', 'Hazles cosquillas a las siguientes ratas de los Especuladores en Tazavesh, el Mercado Velado, en dificultad mítica.', '¡Cosquis!', '', 42010),
(15179, 'esES', 'Derrota a Hylbrande después de insertar solo códigos de baipás bajo los efectos de Campo desinfectante en Tazavesh, el Mercado Velado, en dificultad mítica.', 'Todo controlado', '', 42010),
(15178, 'esES', 'Derrota a So\'leah en Tazavesh, el Mercado Velado, después de que te descubran usando credenciales falsificadas en dificultad mítica.', 'Disimulad, disimulad, malditos', 'Montura de recompensa: deslizador de carga de Tazavesh', 42010),
(15177, 'esES', 'Derrota a So\'leah en Tazavesh, el Mercado Velado, en dificultad mítica.', 'Tazavesh, el Mercado Velado', '', 42010),
(15109, 'esES', 'Derrota a Zo\'phex el Centinela en Tazavesh, el Mercado Velado, embadurnado de 4 sustancias trituradas distintas en dificultad mítica.', '¿Se podrá triturar?', '', 42010),
(15106, 'esES', 'Derrota al jefe de correos tras pasar toda la mercancía inestable a al menos un jugador antes de entregarla en Tazavesh, el Mercado Velado, en dificultad mítica.', 'Control de calidad', '', 42010),
(14607, 'esES', 'Derrota a Tajasangre tras ablandar 2 trozos de carne con Machaque reblandecedor en el Teatro del Dolor en dificultad mítica.', '¡Carne fresca!', '', 42010),
(14606, 'esES', 'Derrota a la tratante Xy\'exa en El Otro Lado tras reunir los 5 orbes que flotan sobre ella en dificultad mítica.', 'Pensando con...', '', 42010),
(14567, 'esES', 'Derrota a Halkias después de que reabsorba los tres fragmentos de Halkias en las Salas de la Expiación en dificultad mítica.', 'Recoger los pedazos', '', 42010),
(14533, 'esES', 'Derrota a Mordretha, la Emperatriz Eterna, tras realizar un reto y derrotar a 2 contendientes fantasmales en el Teatro del Dolor en dificultad mítica.', 'Batalla campal', '', 42010),
(14503, 'esES', 'Derrota a Ingra Maloch tras derrotar a una hidra desmesurada en Nieblas de Tirna Scithe en dificultad mítica.', 'Adicción a la hidroponía', '', 42010),
(14417, 'esES', 'Derrota a Mordretha, la Emperatriz Eterna, en el Teatro del Dolor en dificultad mítica o piedra angular mítica.', 'Mítica: Teatro del Dolor', '', 42010),
