(14412, 'esES', 'Derrota a Tred\'ova en Nieblas de Tirna Scithe en dificultad heroica o superior.', 'Heroica: Nieblas de Tirna Scithe', '', 42010),
(14411, 'esES', 'Derrota al lord chambelán en las Salas de la Expiación en dificultad mítica o piedra angular mítica.', 'Mítica: Salas de la Expiación', '', 42010),
