(14374, 'esES', 'Provoca que Molino y Malífica se ataquen entre sí con cada lanzamiento de Furia de las Sombras y Láser de dedo eco X-tremo, y derrota a los Tormenta de Maná en El Otro Lado en dificultad mítica.', 'Terapia de pareja', '', 42010),
