(14367, 'esES', 'Derrota a Nalthor Clamaescarcha en la Estela Necrótica en dificultad heroica o superior.', 'Heroica: La Estela Necrótica', '', 42010),
(14354, 'esES', 'Derrota a Hakkar, los Tormenta de Maná, la tratante Xy\'exa y Mueh\'zala en El Otro Lado con al menos un miembro del grupo afectado por Sangre corrupta en dificultad mítica durante una única visita.', 'Muy contagiosa', '', 42010),
(14352, 'esES', 'Derrota al lord chambelán en las Salas de la Expiación con 3 estatuas de piedra del pecado en las esquinas de la sala en dificultad mítica.', 'Nadie arrincona a Denathrius', '', 42010),
(14347, 'esES', 'Derrota a Globgrog en Bajapeste tras proporcionarle una comida de tres platos en dificultad mítica.', 'Más cornadas da el hambre', '', 42010),
(14331, 'esES', 'Derrota a Oryphrion tras activar y destruir los tres devastadores destrozados en las Agujas de Ascensión en dificultad mítica.', 'Goliat desactivado', '', 42010),
(14327, 'esES', 'Reúne los cinco orbes con una diferencia de 60 segundos de uno a otro en las Agujas de Ascensión después de derrotar a Devos, dechado de la duda, en dificultad mítica.', 'Desde aquí se ve mi casa', '', 42010),
(14326, 'esES', 'Derrota a Devos, dechado de la duda, en las Agujas de Ascensión.', 'Agujas de Ascensión', '', 42010),
