(14320, 'esES', 'Derrota al cirujano Cosecarne en la Estela Necrótica después de destruir dos barricas de piezas de repuesto en dificultad mítica.', 'Suministros de cirujano', '', 42010),
(14297, 'esES', 'Derrota a cada combatiente en último lugar disputando en varias ocasiones el encuentro de la afronta de contendientes en el Teatro del Dolor en dificultad mítica.', 'No hay dos sin tres', '', 42010),
(14296, 'esES', 'Derrota al doctor Ickus en Bajapeste tras destruir 2 bombas de peste volátiles en dificultad mítica.', 'Hacerse viral', '', 42010),
(14295, 'esES', 'Derrota a Amarth el Cosechador en la Estela Necrótica después de que consuma el cadáver de un coloso macabro con Última cosecha en dificultad mítica.', 'Cosecha generosa', '', 42010),
(14292, 'esES', 'Derrota a todos los jefes de Bajapeste mientras estás afectado por Bajapestado en dificultad mítica durante una única visita.', 'De farra con mis babas', '', 42010),
(14291, 'esES', 'Encuentra los 6 juguetes de Clamaneblina en las Nieblas de Tirna Scithe en dificultad mítica.', '¡Alguien podría tropezarse con esto!', '', 42010),
(14290, 'esES', 'Derrota a Duraka el Inquebrantable en las Cavernas Sanguinas en dificultad mítica.', 'Solo tengo ojos para ti', '', 42010),
(14289, 'esES', 'Derrota a la general Kaal mientras estás bajo los efectos de ¡Machacado! en las Cavernas Sanguinas en dificultad mítica.', 'Kaal-amidad', '', 42010),
(14286, 'esES', 'Derrota al ejecutor Tarvold después de matar a 8 cautivos melancólicos bajo los efectos de Residuo en las Cavernas Sanguinas en dificultad mítica.', 'Mal residual', '', 42010),
(14285, 'esES', 'Derrota a Nalthor Clamaescarcha sin que te golpee con Lluvia de cometas, Ventisca o el efecto secundario de Ataduras congeladas en la Estela Necrótica en dificultad mítica.', 'Listo para asaltar VII', '', 42010),
(14284, 'esES', 'Derrota a Echelon después de destrozar a 18 malignos de piedra inmortales o más de una vez en las Salas de la Expiación en dificultad mítica.', 'Destruyendo que es gerundio', '', 42010),
(14199, 'esES', 'Derrota a la general Kaal en las Cavernas Sanguinas en dificultad mítica o piedra angular mítica.', 'Mítica: Cavernas Sanguinas', '', 42010),
(14198, 'esES', 'Derrota a la general Kaal en las Cavernas Sanguinas en dificultad heroica o superior.', 'Heroica: Cavernas Sanguinas', '', 42010),
