(13930, 'esES', 'Consigue 200 distintivos del tiempo haciendo misiones y participando en el Valle de Alterac clásico.', 'El Valle de Alterac de antaño', 'Recompensa: gruñidor Lobo Gélido', 42010),
(13928, 'esES', 'Consigue 200 distintivos del tiempo haciendo misiones y participando en el Valle de Alterac clásico.', 'El Valle de Alterac de antaño', 'Recompensa: carnero de batalla de Pico Tormenta', 42010),
