(14734, 'esES', 'Haz sonar las cinco campanas de vísperas de los templos en Bastión para invocar al Consejo de los Ascendidos.', 'Llamando a los Ascendidos', '', 42010),
(14733, 'esES', 'Sobrevive a la ira de Bailasol y gánate el derecho a desafiarlo a una prueba de combate.', 'Silla caliente', '', 42010),
