(14626, 'esES', 'Consigue a Aterrapenas en el Teatro del Dolor.', 'Cosechador de pena', '', 42010),
(14353, 'esES', 'Participa en las siguientes obras en el Anfiteatro del Lago Estrellado:', 'Ardenweald es un escenario', '', 42010),
(14339, 'esES', 'Encuentra todos los fragmentos de cristal de ánima perdidos en Bastión.', 'Trabajo fragmentario', '', 42010),
