(15403, 'esMX', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'esMX', 'Hazles cosquillas a las siguientes ratas de los negociantes en Tazavesh, el Mercado Velado en dificultad mítica.', '¡Travesuras!', '', 42010),
(15179, 'esMX', 'Derrota a Hylbrande después de insertar solo los códigos de anulación mientras sufres el efecto de Campo desinfectante en Tazavesh, el Mercado Velado en dificultad mítica.', 'Todo está bien, todo está bien…', '', 42010),
(15178, 'esMX', 'Derrota a So\'leah en Tazavesh, el Mercado Velado después de que descubran tus credenciales fraudulentas en dificultad mítica.', '¿Quién se va a dar cuenta?', 'Montura de recompensa: Planeador de Tazavesh', 42010),
(15177, 'esMX', 'Derrota a So\'leah en Tazavesh, el Mercado Velado en dificultad mítica.', 'Tazavesh, el Mercado Velado', '', 42010),
(15109, 'esMX', 'Derrota a Zo\'phex, el Centinela, mientras te cubren 4 sustancias licuadas distintas en Tazavesh, el Mercado Velado, en dificultad mítica.', 'La licuadora que todo lo licúa', '', 42010),
(15106, 'esMX', 'Derrota al jefe de C.A.R.T.A. luego de haber pasado los bienes inestables al menos a un jugador antes de entregarlos en Tazavesh, el Mercado Velado, en dificultad mítica.', 'Control de calidad', '', 42010),
(14607, 'esMX', 'Derrota a Cortecruel después de suavizar 2 pedazos de carne con Machaque suavizante en el Teatro del Dolor en dificultad mítica.', '¡Carne fresca!', '', 42010),
(14606, 'esMX', 'Derrota a la tratante Xy\'exa después de recolectar los 5 orbes que flotan sobre ella en El Otro Lado en dificultad mítica.', 'Pensamientos conjuntos...', '', 42010),
(14567, 'esMX', 'Derrota a Halkias después de que reabsorba las tres esquirlas de Halkias en los Salones de Expiación en dificultad mítica.', 'Recoger los pedazos', '', 42010),
(14533, 'esMX', 'Derrota a Mordretha, la Emperatriz eterna, después de realizar un /reto y derrotar a 2 contrincantes fantasmales en el Teatro del Dolor en dificultad mítica.', 'Reyerta real', '', 42010),
(14503, 'esMX', 'Derrota a Ingra Maloch después de derrotar a una hidra descomunal en Nieblas de Tirna Scithe en dificultad mítica.', 'No olvides hidratarte', '', 42010),
(14417, 'esMX', 'Derrota a Mordretha, la Emperatriz eterna, en el Teatro del Dolor en dificultad mítica o piedra angular mítica.', 'Mítico: Teatro del Dolor', '', 42010),
(14416, 'esMX', 'Derrota a Mordretha, la Emperatriz eterna, en el Teatro del Dolor en dificultad heroica o superior.', 'Heroico: Teatro del Dolor', '', 42010),
(14415, 'esMX', 'Derrota a la margravina Stradama en Plaga Abrumadora en dificultad mítica o piedra angular mítica.', 'Mítico: Plaga Abrumadora', '', 42010),
(14414, 'esMX', 'Derrota a la margravina Stradama en Plaga Abrumadora en dificultad heroica o superior.', 'Heroico: Plaga Abrumadora', '', 42010),
(14413, 'esMX', 'Derrota a Tred\'ova en Nieblas de Tirna Scithe en dificultad mítica o piedra angular mítica.', 'Mítico: Nieblas de Tirna Scithe', '', 42010),
(14412, 'esMX', 'Derrota a Tred\'ova en Nieblas de Tirna Scithe en dificultad heroica o superior.', 'Heroico: Nieblas de Tirna Scithe', '', 42010),
