INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'frFR', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'frFR', 'Chatouiller les rats de négociants suivants dans Tazavesh, le marché dissimulé, en mode mythique.', 'Attaque de chatouilles !', '', 42010),
(15179, 'frFR', 'Vaincre Hylbrande après avoir inséré des codes de contournement uniquement, tout en subissant les effets du champ d\’assainissement à Tazavesh, le marché dissimulé, en mode mythique.', 'Tout va bien se passer', '', 42010),
(15178, 'frFR', 'Vaincre So\’leah à Tazavesh, le marché dissimulé, après avoir tenté d\’utiliser une fausse identité en mode mythique.', 'Il faut savoir persévérer', 'Monture : mécaplaneur de Tazavesh', 42010),
(15177, 'frFR', 'Vaincre So\’leah à Tazavesh, le marché dissimulé, en mode mythique.', 'Tazavesh, le marché dissimulé', '', 42010),
(15109, 'frFR', 'Vaincre Zo\’phex la sentinelle en étant couvert de 4 substances mixées différentes à Tazavesh, le marché dissimulé, en mode mythique.', 'Moulin\’ex', '', 42010),
(15106, 'frFR', 'Vaincre le maître de P.O.S.T.E. après avoir transmis toutes les marchandises instables à au moins un autre personnage-joueur avant livraison à Tazavesh, le marché dissimulé, en mode mythique.', 'Contrôle qualité', '', 42010),
(14607, 'frFR', 'Vaincre Trancheboyau après avoir attendri 2 morceaux de viande avec Choc attendrisseur dans le théâtre de la Souffrance en mode mythique.', 'Viande fraîche !', '', 42010),
(14606, 'frFR', 'Vaincre la marchande Xy\’exa après avoir récupéré les 5 orbes flottant au-dessus d\’elle de l\’Autre côté en mode mythique.', 'Réflexion faite', '', 42010),
(14567, 'frFR', 'Vaincre Halkias après qu\’il a réabsorbé les 3 éclats d\’Halkias dans les salles de l\’Expiation en mode mythique.', 'Ramasser les morceaux', '', 42010),
(14533, 'frFR', 'Vaincre Mordretha, l\’impératrice immortelle, après l\’avoir /défiée et avoir terrassé 2 belligérants fantomatiques dans le théâtre de la Souffrance en mode mythique.', 'Rixe royale', '', 42010),
(14503, 'frFR', 'Vaincre l\’ingra Maloch après avoir abattu une hydre géante dans les Brumes de Tirna Scithe, en mode mythique.', 'Expert en hydroponie', '', 42010),
(14417, 'frFR', 'Vaincre Mordretha, l\’impératrice immortelle, dans le théâtre de la Souffrance en mode mythique ou clé mythique.', 'Théâtre de la Souffrance : mode mythique', '', 42010),
(14416, 'frFR', 'Vaincre Mordretha, l\’impératrice immortelle, dans le théâtre de la Souffrance en mode héroïque ou supérieur.', 'Théâtre de la Souffrance : mode héroïque', '', 42010),
(14415, 'frFR', 'Vaincre la margrave Stradama à Malepeste en mode mythique ou clé mythique.', 'Malepeste : mode mythique', '', 42010),
(14414, 'frFR', 'Vaincre la margrave Stradama à Malepeste en mode héroïque ou supérieur.', 'Malepeste : mode héroïque', '', 42010),
(14413, 'frFR', 'Vaincre Tred\’ova dans les Brumes de Tirna Scithe en mode mythique ou clé mythique.', 'Brumes de Tirna Scithe : mode mythique', '', 42010),
(14412, 'frFR', 'Vaincre Tred\’ova dans les Brumes de Tirna Scithe en mode héroïque ou supérieur.', 'Brumes de Tirna Scithe : mode héroïque', '', 42010),
(14411, 'frFR', 'Vaincre le grand chambellan dans les salles de l\’Expiation en mode mythique ou clé mythique.', 'Salles de l\’Expiation : mode mythique', '', 42010),
(14410, 'frFR', 'Vaincre le grand chambellan dans les salles de l\’Expiation en mode héroïque ou supérieur.', 'Salles de l\’Expiation : mode héroïque', '', 42010),
(14409, 'frFR', 'Vaincre Mueh\’zala de l\’Autre côté en mode mythique ou clé mythique.', 'L\’Autre côté : mode mythique', '', 42010),
(14408, 'frFR', 'Vaincre Mueh\’zala de l\’Autre côté en mode héroïque ou supérieur.', 'L\’Autre côté : mode héroïque', '', 42010),
(14375, 'frFR', 'Vaincre Tred\’ova après avoir abattu un goinfre gueule-épine évolué dans les Brumes de Tirna Scithe en mode mythique.', 'Appétit de connaissances', '', 42010),
(14374, 'frFR', 'Faire en sorte que Milhouse et Millificent s\’infligent mutuellement des dégâts avec chaque incantation de Furie de l\’ombre et Laser digital X-trême Echo, et vaincre les Tempête-de-Mana de l\’Autre côté en mode mythique.', 'Thérapie de couple', '', 42010),
(14373, 'frFR', 'Vaincre Mueh\’zala de l\’Autre côté.', 'L\’Autre côté', '', 42010),
(14372, 'frFR', 'Vaincre Mordretha, l\’impératrice immortelle, dans le théâtre de la Souffrance.', 'Théâtre de la Souffrance', '', 42010),
(14371, 'frFR', 'Vaincre Tred\’ova dans les Brumes de Tirna Scithe.', 'Brumes de Tirna Scithe', '', 42010),
(14370, 'frFR', 'Vaincre le grand chambellan dans les salles de l\’Expiation.', 'Salles de l\’Expiation', '', 42010),
(14369, 'frFR', 'Vaincre la margrave Stradama à Malepeste.', 'Malepeste', '', 42010),
(14368, 'frFR', 'Vaincre Nalthor le Lieur-de-Givre dans le Sillage nécrotique en mode mythique ou clé mythique.', 'Sillage nécrotique : mode mythique', '', 42010),
(14367, 'frFR', 'Vaincre Nalthor le Lieur-de-Givre dans le Sillage nécrotique en mode héroïque ou supérieur.', 'Sillage nécrotique : mode héroïque', '', 42010),
(14354, 'frFR', 'Vaincre Hakkar, les Tempête-de-Mana, la marchande Xy\’exa et Mueh\’zala alors qu\’au moins un membre du groupe est victime de Sang vicié lors d\’une même visite de l\’Autre côté en mode mythique.', 'Hautement contagieux', '', 42010),
(14352, 'frFR', 'Vaincre le grand chambellan avec 3 statues stèles du vice aux angles de la pièce dans les salles de l\’Expiation en mode mythique.', 'On ne laisse pas Denathrius dans un coin', '', 42010),
(14347, 'frFR', 'Vaincre Globgrog après l\’avoir nourri 3 fois à Malepeste en mode mythique.', 'Entrée-plat-dessert', '', 42010),
(14331, 'frFR', 'Terrasser Oryphrione après avoir activé et détruit les 3 Dévastateurs brisés dans les flèches de l\’Ascension en mode mythique.', 'Goliath désactivé', '', 42010),
(14327, 'frFR', 'Rassembler les 5 orbes à moins de 60 s d\’intervalle après avoir vaincu Déva, le parangon de doute, dans les flèches de l\’Ascension en mode mythique.', 'Je vois ma maison d\’ici', '', 42010),
