INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'itIT', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'itIT', 'Fai il solletico ai seguenti ratti degli Alienatori a Tazavesh, il Bazar Celato in modalità Mitica.', 'Birichino!', '', 42010),
(15179, 'itIT', 'Sconfiggi Hylbrande dopo aver inserito solo i Codici di Aggiramento sotto gli effetti di Campo Sanitizzante a Tazavesh, il Bazar Celato in modalità Mitica.', 'Va tutto bene', '', 42010),
(15178, 'itIT', 'Sconfiggi So\'leah dopo essere stato scoperto a usare credenziali falsificate a Tazavesh, il Bazar Celato in modalità Mitica.', 'Per finta con grinta', 'Ricompensa: cavalcatura \"Meccaliante di Tazavesh\"', 42010),
(15177, 'itIT', 'Sconfiggi So\'leah a Tazavesh, il Bazar Celato in modalità Mitica.', 'Tazavesh, il Bazar Celato', '', 42010),
(15109, 'itIT', 'Sconfiggi Zo\'phex la Sentinella mentre sei ricoperto da 4 diverse sostanze frullate a Tazavesh, il Bazar Celato in modalità Mitica.', 'Si frullerà?', '', 42010),
(15106, 'itIT', 'Sconfiggi il Direttore della P.O.S.T.A. dopo aver passato tutti i Beni Instabili ad almeno un altro personaggio prima della consegna a Tazavesh, il Bazar Celato in modalità Mitica.', 'Controllo qualità', '', 42010),
(14607, 'itIT', 'Sconfiggi Fendisangue dopo aver distrutto 2 Ganci per Carne con Colpo Pestacarne nel Teatro del Dolore in modalità Mitica.', 'Carne fresca!', '', 42010),
(14606, 'itIT', 'Sconfiggi la Fornitrice Xy\'exa dopo aver raccolto tutti e 5 i globi sospesi sopra di lei nell\'Aldilà in modalità Mitica.', 'A pensarci bene...', '', 42010),
(14567, 'itIT', 'Sconfiggi Halkias dopo che ha riassorbito tutte e tre le Schegge di Halkias nelle Sale della Redenzione in modalità Mitica.', '...e i cocci sono suoi', '', 42010),
(14533, 'itIT', 'Sconfiggi Mordretha, l\'Imperatrice Eterna, dopo aver lanciato una /sfida e aver sconfitto 2 Contendenti Spettrali nel Teatro del Dolore in modalità Mitica.', 'Rissa imperiale', '', 42010),
(14503, 'itIT', 'Sconfiggi Ingra Maloch dopo aver sconfitto un\'Idra Ipertrofica nelle Nebbie di Tirna Falcis in modalità Mitica.', 'Dipendente dall\'acquacoltura', '', 42010),
(14417, 'itIT', 'Sconfiggi Mordretha, l\'Imperatrice Eterna nel Teatro del Dolore in modalità Mitica o Mitica+.', 'Mitica: Teatro del Dolore', '', 42010),
(14416, 'itIT', 'Sconfiggi Mordretha, l\'Imperatrice Eterna nel Teatro del Dolore in modalità Eroica o superiore.', 'Eroica: Teatro del Dolore', '', 42010),
(14415, 'itIT', 'Sconfiggi il Margravio Stradama a Piagafunesta in modalità Mitica o Mitica+.', 'Mitica: Piagafunesta', '', 42010),
(14414, 'itIT', 'Sconfiggi il Margravio Stradama a Piagafunesta in modalità Eroica o superiore.', 'Eroica: Piagafunesta', '', 42010),
(14413, 'itIT', 'Sconfiggi Tred\'ova nelle Nebbie di Tirna Falcis in modalità Mitica o Mitica+.', 'Mitica: Nebbie di Tirna Falcis', '', 42010),
(14412, 'itIT', 'Sconfiggi Tred\'ova nelle Nebbie di Tirna Falcis in modalità Eroica o superiore.', 'Eroica: Nebbie di Tirna Falcis', '', 42010),
(14411, 'itIT', 'Sconfiggi il Ciambellano Supremo nelle Sale della Redenzione in modalità Mitica o Mitica+.', 'Mitica: Sale della Redenzione', '', 42010),
(14410, 'itIT', 'Sconfiggi il Ciambellano Supremo nelle Sale della Redenzione in modalità Eroica o superiore.', 'Eroica: Sale della Redenzione', '', 42010),
(14409, 'itIT', 'Sconfiggi Mueh\'zala nell\'Aldilà in modalità Mitica o Mitica+.', 'Mitica: L\'Aldilà', '', 42010),
(14408, 'itIT', 'Sconfiggi Mueh\'zala nell\'Aldilà in modalità Eroica o superiore.', 'Eroica: L\'Aldilà', '', 42010),
(14375, 'itIT', 'Sconfiggi Tred\'ova dopo aver sconfitto un Mangiatore Spinafauce Illuminato nelle Nebbie di Tirna Falcis in modalità Mitica.', 'Conoscenza insaziabile', '', 42010),
(14374, 'itIT', 'Fai in modo che Millhouse e Millefica si colpiscano a vicenda con ogni lancio di Furia dell\'Ombra e Laser Estremo Eco e sconfiggi i Manalampo nell\'Aldilà in modalità Mitica.', 'Terapia di coppia', '', 42010),
(14373, 'itIT', 'Sconfiggi Mueh\'zala nell\'Aldilà.', 'L\'Aldilà', '', 42010),
(14372, 'itIT', 'Sconfiggi Mordretha, l\'Imperatrice Eterna nel Teatro del Dolore.', 'Teatro del Dolore', '', 42010),
(14371, 'itIT', 'Sconfiggi Tred\'ova nelle Nebbie di Tirna Falcis.', 'Nebbie di Tirna Falcis', '', 42010),
(14370, 'itIT', 'Sconfiggi il Ciambellano Supremo nelle Sale della Redenzione.', 'Sale della Redenzione', '', 42010),
(14369, 'itIT', 'Sconfiggi il Margravio Stradama a Piagafunesta.', 'Piagafunesta', '', 42010),
(14368, 'itIT', 'Sconfiggi Nalthor il Vincolabrina nella Scia Necrotica in modalità Mitica o Mitica+.', 'Mitica: Scia Necrotica', '', 42010),
(14367, 'itIT', 'Sconfiggi Nalthor il Vincolabrina nella Scia Necrotica in modalità Eroica o superiore.', 'Eroica: Scia Necrotica', '', 42010),
(14354, 'itIT', 'Sconfiggi Hakkar, i Manalampo, la Fornitrice Xy\'exa e Mueh\'zala mentre almeno un membro del gruppo è sotto gli effetti di Sangue Corrotto in una singola visita nell\'Aldilà in modalità Mitica.', 'Altamente comunicabile', '', 42010),
(14352, 'itIT', 'Sconfiggi il Ciambellano Supremo con 3 Statue di Pietra del Peccato negli angoli della stanza nelle Sale della Redenzione in modalità Mitica.', 'Nessuno mette all\'angolo Denathrius', '', 42010),
(14347, 'itIT', 'Sconfiggi Blobgrog dopo avergli dato da mangiare tre portate a Piagafunesta in modalità Mitica.', 'Pasto di sangue completo', '', 42010),
(14331, 'itIT', 'Sconfiggi Orifrion dopo aver attivato e distrutto tutti i tre Devastatori Infranti nelle Guglie dell\'Ascensione in modalità Mitica.', 'Disattivazione Mastodontica', '', 42010),
(14327, 'itIT', 'Raccogli tutti e cinque i globi entro 60 secondi l\'uno dall\'altro dopo aver sconfitto Devos, Eletta del Dubbio nelle Guglie dell\'Ascensione in modalità Mitica.', 'Da qui posso vedere casa mia', '', 42010),
(14326, 'itIT', 'Sconfiggi Devos, Eletta del Dubbio, nelle Guglie dell\'Ascensione.', 'Guglie dell\'Ascensione', '', 42010),
(14325, 'itIT', 'Sconfiggi Devos, Eletta del Dubbio, nelle Guglie dell\'Ascensione in modalità Mitica o Mitica+.', 'Mitica: Guglie dell\'Ascensione', '', 42010),
(14324, 'itIT', 'Sconfiggi Devos, Eletta del Dubbio, nelle Guglie dell\'Ascensione in modalità Eroica o superiore.', 'Eroica: Guglie dell\'Ascensione', '', 42010),
(14323, 'itIT', 'Sconfiggi Devos, Eletta del Dubbio dopo averla colpita con 5 Lance del Dovere nelle Guglie dell\'Ascensione in modalità Mitica.', 'SbiLANCIAmento', '', 42010),
(14320, 'itIT', 'Sconfiggi il Chirurgo Cucicarne dopo aver distrutto due barili di pezzi di ricambio nella Scia Necrotica in modalità Mitica.', 'Scorte del Chirurgo', '', 42010),
(14297, 'itIT', 'Sconfiggi i combattenti di ogni Affronto degli Sfidanti per ultimi in occasioni diverse nel Teatro del Dolore in modalità Mitica.', 'Tripla Scelta', '', 42010),
(14296, 'itIT', 'Sconfiggi Dottor Skifus dopo aver distrutto 2 Bombe Pestilenziali Instabili a Piagafunesta in modalità Mitica.', 'Diventare Virali', '', 42010),
(14295, 'itIT', 'Sconfiggi Amarth il Mietitore dopo che ha consumato il corpo di un Colosso Macabro con Raccolta Finale nella Scia Necrotica in modalità Mitica.', 'Raccolto abbondante', '', 42010),
(14292, 'itIT', 'Sconfiggi tutti i boss mentre sei sotto gli effetti di Caduto della Piaga in una singola visita a Piagafunesta in modalità Mitica.', 'Poltiglie senza briglie', '', 42010),
(14291, 'itIT', 'Trova i 6 giocattoli dell\'Evocanebbie nelle Nebbie di Tirna Falcis in modalità Mitica.', 'Qualcuno potrebbe inciamparci!', '', 42010),
(14290, 'itIT', 'Sconfiggi Duraka l\'Indistruttibile nelle Profondità Sanguigne in modalità Mitica.', 'Duraka a morire', '', 42010),
(14289, 'itIT', 'Sconfiggi il Generale Kaal mentre è affetto da Colpito! nelle Profondità Sanguigne in modalità Mitica.', 'Kaal-pito e affondato', '', 42010),
(14286, 'itIT', 'Sconfiggi l\'Esecutore Tarvold nelle Profondità Sanguigne in modalità Mitica dopo aver ucciso 8 Prigionieri Disperati sotto l\'effetto di Residuo.', 'Malvagità Residua', '', 42010),
(14285, 'itIT', 'Sconfiggi Nalthor il Vincolabrina senza venire colpito da Tempesta di Comete, Tormenta o dall\'effetto secondario di Vincoli Gelidi nella Scia Necrotica in modalità Mitica.', 'Pronto per le incursioni VII', '', 42010),
(14284, 'itIT', 'Sconfiggi Eminenth dopo aver distrutto 18 o più Bestiaroccia Imperiture nelle Sale della Redenzione in modalità Mitica.', 'Una gran rottura di pietre', '', 42010),
(14199, 'itIT', 'Sconfiggi il Generale Kaal nelle Profondità Sanguigne in modalità Mitica o Mitica+.', 'Mitica: Profondità Sanguigne', '', 42010),
(14198, 'itIT', 'Sconfiggi il Generale Kaal nelle Profondità Sanguigne in modalità Eroica o superiore.', 'Eroica: Profondità Sanguigne', '', 42010),
(14197, 'itIT', 'Sconfiggi il Generale Kaal nelle Profondità Sanguigne.', 'Profondità Sanguigne', '', 42010),
