(13930, 'itIT', 'Ottieni 200 Distintivi Fuoritempo completando missioni e partecipando a battaglie nella Valle d\'Alterac Classica.', 'Valle d\'Alterac d\'altri tempi', 'Ricompensa: Ringhiatore dei Lupi Bianchi', 42010),
(13928, 'itIT', 'Ottieni 200 Distintivi Fuoritempo completando missioni e partecipando a battaglie nella Valle d\'Alterac Classica.', 'Valle d\'Alterac d\'altri tempi', 'Ricompensa: Montone da Battaglia dei Piccatonante', 42010),
(15388, 'itIT', 'Esplora le regioni delle Terretetre.', 'Esploratore delle Terretetre', '', 42010),
(14825, 'itIT', 'Compi le imprese delle Terretetre elencate qui sotto.', 'Viaggiatore delle Terretetre', '', 42010),
(14802, 'itIT', 'Sconfiggi tutti e sette i campioni nel Teatro del Dolore.', 'Sport mortale', '', 42010),
(14791, 'itIT', 'Lancia un Seme Debolmente Luminoso a Gwynceirw, il Lupo Invernale, durante o dopo il combattimento con il Boggart del Pantano.', 'Dona un Seme al tuo cacciatore...', '', 42010),
(14788, 'itIT', 'Riporta i libri perduti elencati qui sotto a Selvarden.', 'Le fiabe della buonanotte', '', 42010),
