INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'koKR', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'koKR', '미지의 시장 타자베쉬에서 다음 중개자 쥐 간지럽히기', '이런 장난꾸러기!', '', 42010),
(15179, 'koKR', '미지의 시장 타자베쉬에서 방역 지대의 효과를 받는 상태로 우회 암호를 삽입한 직후 힐브란데 처치 (신화)', '방역을 하려면 제대로 해야죠', '', 42010),
(15178, 'koKR', '미지의 시장 타자베쉬에서 위조 신분증을 사용하다 들통난 후 소레아 처치 (신화)', '필요한 만큼은 보여줬다', '탈것: 타자베쉬 톱니글라이더', 42010),
(15177, 'koKR', '미지의 시장 타자베쉬에서 소레아 처치 (신화)', '미지의 시장 타자베쉬', '', 42010),
(15109, 'koKR', '미지의 시장 타자베쉬에서 서로 다른 네 가지의 갈려 나간 물질에 뒤덮인 상태로 파수꾼 조펙스 처치 (신화)', '과연 이것도 갈릴까요?', '', 42010),
(15106, 'koKR', '미지의 시장 타자베쉬에서 모든 불안정한 상품을 최소한 다른 한 명의 플레이어에게 넘겨준 다음 배달을 마친 후 우.정.국.장. 처치 (신화)', '차원문 앞에 놓고 가 주세요', '', 42010),
(14607, 'koKR', '고통의 투기장에서 선혈토막이 다지기 강타로 고깃덩어리 2개를 다진 후 처치 (신화)', '고기는 이렇게 다져주세유!', '', 42010),
(14606, 'koKR', '저편에서 무역업자 자이엑사가 위에 떠다니는 보주 5개를 모두 수집한 후 처치 (신화)', '보주가 다섯 개!', '', 42010),
(14567, 'koKR', '속죄의 전당에서 할키아스가 할키아스의 조각 3개를 모두 다시 흡수한 후 처치 (신화)', '한 조, 아니... 세 조각 압수!', '', 42010),
(14533, 'koKR', '고통의 투기장에서 /도전 감정표현을 사용하고 유령 경쟁자를 2명 처치한 후 무한의 여제 모르드레타 처치 (신화)', '도전자 두둥등장', '', 42010),
(14503, 'koKR', '티르너 사이드의 안개에서 비대해진 히드라를 처치한 후 잉그라 말로크 처치 (신화)', '엄마! 히드라가 자꾸 커져요', '', 42010),
(14417, 'koKR', '고통의 투기장에서 무한의 여제 모르드레타 처치 (신화 또는 신화 쐐기돌)', '신화: 고통의 투기장', '', 42010),
(14416, 'koKR', '고통의 투기장에서 무한의 여제 모르드레타 처치 (영웅 난이도 이상)', '영웅: 고통의 투기장', '', 42010),
(14415, 'koKR', '역병 몰락지에서 후작 스트라다마 처치 (신화 또는 신화 쐐기돌)', '신화: 역병 몰락지', '', 42010),
(14414, 'koKR', '역병 몰락지에서 후작 스트라다마 처치 (영웅 난이도 이상)', '영웅: 역병 몰락지', '', 42010),
