(14412, 'koKR', '티르너 사이드의 안개에서 트레도바 처치 (영웅 난이도 이상)', '영웅: 티르너 사이드의 안개', '', 42010),
(14411, 'koKR', '속죄의 전당에서 시종장 처치 (신화 또는 신화 쐐기돌)', '신화: 속죄의 전당', '', 42010),
(14410, 'koKR', '속죄의 전당에서 시종장 처치 (영웅 난이도 이상)', '영웅: 속죄의 전당', '', 42010),
(14409, 'koKR', '저편에서 무에젤라 처치 (신화 또는 신화 쐐기돌)', '신화: 저편', '', 42010),
(14408, 'koKR', '저편에서 무에젤라 처치 (영웅 난이도 이상)', '영웅: 저편', '', 42010),
(14375, 'koKR', '티르너 사이드의 안개에서 계몽된 가시아귀 먹보를 처치한 후 트레도바 처치 (신화)', '지식 갈망', '', 42010),
(14374, 'koKR', '저편에서 밀하우스와 밀리피센트가 제각기 어둠의 격노와 에코 초강력 손가락 레이저를 시전할 때 서로를 공격하게 한 후 마나스톰 부부 처치 (신화)', '당신이 어떻게 나한테 이럴 수 있어?', '', 42010),
