(14368, 'koKR', '죽음의 상흔에서 냉기결속사 날토르 처치 (신화 또는 신화 쐐기돌)', '신화: 죽음의 상흔', '', 42010),
(14367, 'koKR', '죽음의 상흔에서 냉기결속사 날토르 처치 (영웅 난이도 이상)', '영웅: 죽음의 상흔', '', 42010),
(14354, 'koKR', '저편에서 최소 한 명의 파티원이 오염된 피에 걸린 상태에서 한 번의 방문 안에 학카르, 마나스톰 부부, 무역업자 자이엑사, 무에젤라 처치 (신화)', '타락한 피도 우릴 막을 순 없으셈', '', 42010),
(14352, 'koKR', '속죄의 전당에서 방 안 모퉁이에 죄악석 석상이 3개 존재하는 상태에서 시종장 처치 (신화)', '누구든 데나트리우스를 건드리면 큰일나는 거예요', '', 42010),
(14347, 'koKR', '역병 몰락지에서 점액살거수에게 식사를 3회 시킨 후 처치 (신화)', '먹고 죽은 점액살거수가 때깔도 곱다', '', 42010),
(14331, 'koKR', '승천의 첨탑에서 조각난 파괴자 세 대를 모두 활성화하여 파괴한 후 오리프리온 처치 (신화)', '거수 가동 중지', '', 42010),
(14327, 'koKR', '승천의 첨탑에서 의심의 용장 데보스 처치하고 60초 안에 다섯 개의 보주 모두 수집 (신화)', '여기서 우리 집도 보이네', '', 42010),
(14326, 'koKR', '승천의 첨탑에서 의심의 용장 데보스 처치', '승천의 첨탑', '', 42010),
(14325, 'koKR', '승천의 첨탑에서 의심의 용장 데보스 처치 (신화 또는 신화 쐐기돌)', '신화: 승천의 첨탑', '', 42010),
(14324, 'koKR', '승천의 첨탑에서 의심의 용장 데보스 처치 (영웅 난이도 이상)', '영웅: 승천의 첨탑', '', 42010),
(14323, 'koKR', '승천의 첨탑에서 의심의 용장 데보스에게 과업의 창을 5번 적중한 후 처치 (신화)', '창 앞에 모두 평등하다', '', 42010),
(14320, 'koKR', '죽음의 상흔에서 예비 부위 통 2개를 파괴한 후 의사 스티치플레시 처치 (신화)', '이 통은 내가 집도한다', '', 42010),
(14297, 'koKR', '고통의 투기장에서 오만불손한 도전자 전투를 여러 차례 완료하며 각각의 전투원을 마지막에 처치 (신화)', '당신의 선택은?', '', 42010),
(14296, 'koKR', '역병 몰락지에서 불안정한 역병 폭탄 2개를 파괴한 후 의사 이커스 처치 (신화)', '폭발물 처리반', '', 42010),
(14295, 'koKR', '죽음의 상흔에서 수확자 아마스가 마지막 수확을 사용해 소름 끼치는 거신의 시체를 흡수하게 한 후 처치 (신화)', '풍족한 수확', '', 42010),
(14292, 'koKR', '역병 몰락지에서 역병 몰락자 효과에 영향을 받는 동안 한 번의 방문 안에 모든 우두머리 처치 (신화)', '수액이 내가 된다!', '', 42010),
(14291, 'koKR', '티르너 사이드의 안개에서 미스트콜러의 장난감 6개 찾기 (신화)', '누가 이렇게 장난쳐 놓으래?', '', 42010),
(14290, 'koKR', '핏빛 심연에서 불굴의 듀라카 처치 (신화)', '너만 보인단 말이야', '', 42010),
(14289, 'koKR', '핏빛 심연에서 대격돌! 효과에 영향을 받는 동안 장군 카알 처치 (신화)', '카알 같은 타이밍', '', 42010),
(14286, 'koKR', '핏빛 심연에서 잔류물의 효과를 받는 버려진 포로 8명을 처치한 후 집행관 타르볼드 처치 (신화)', '잔류하는 악', '', 42010),
(14285, 'koKR', '죽음의 상흔에서 혜성 폭풍, 눈보라 또는 얼어붙은 구속의 보조 효과에 적중당하지 않고 냉기결속사 날토르 처치 (신화)', '공격 준비 완료 VII', '', 42010),
(14284, 'koKR', '속죄의 전당에서 한 번에 18마리 이상의 불멸의 돌마귀를 산산이 조각낸 후 에첼론 처치 (신화)', '돌마귀 바사삭', '', 42010),
(14199, 'koKR', '핏빛 심연에서 장군 카알 처치 (신화 또는 신화 쐐기돌)', '신화: 핏빛 심연', '', 42010),
