(14197, 'koKR', '핏빛 심연에서 장군 카알 처치', '핏빛 심연', '', 42010),
(15395, 'koKR', '', 'Fae\'s Giving [DNT]', '', 42010),
(13930, 'koKR', '알터랙 계곡 클래식 참여 및 퀘스트를 통해 시간왜곡의 훈장 200개 수집', '그때 그 시절 알터랙 계곡', '보상: 서리늑대 야수', 42010),
(13928, 'koKR', '알터랙 계곡 클래식 참여 및 퀘스트를 통해 시간왜곡의 훈장 200개 수집', '그때 그 시절 알터랙 계곡', '보상: 스톰파이크 전쟁 산양', 42010),
