INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'ruRU', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'ruRU', 'Пощекочите перечисленных крыс брокеров на тайном рынке Тазавеш в эпохальном режиме.', 'Вот проказник!', '', 42010),
(15179, 'ruRU', 'Победите Хильбранда на тайном рынке Тазавеш в эпохальном режиме, введя коды взлома под действием поля санации.', 'Все в порядке', '', 42010),
(15178, 'ruRU', 'Победите Со\'лею на тайном рынке Тазавеш в эпохальном режиме после того, как вас разоблачат при попытке использовать поддельные документы.', 'Делай как можешь, пока не сможешь как надо', 'Награда: тазавешский техноглайдер', 42010),
(15177, 'ruRU', 'Победите Со\'лею на тайном рынке Тазавеш в эпохальном режиме.', 'Тайный рынок Тазавеш', '', 42010),
(15109, 'ruRU', 'Победите Зо\'фекса Часового на тайном рынке Тазавеш в эпохальном режиме, находясь под воздействием 4 измельченных субстанций.', 'Воздушный блендер', '', 42010),
(15106, 'ruRU', 'Победите ПОЧТ-мейстера на тайном рынке Тазавеш в эпохальном режиме, передав все нестабильные грузы хотя бы одному другому игроку, перед тем как бросить в портал доставки.', 'Контроль качества', '', 42010),
(14607, 'ruRU', 'Победите Кроворуба в Театре Боли в эпохальном режиме, отбив 2 куска мяса с помощью \"Превращения в отбивную\".', 'Свежее мясо!', '', 42010),
(14606, 'ruRU', 'Победите дилера Зи\'ексу на Той Стороне в эпохальном режиме, собрав все 5 летающих над ней сфер.', 'Надо подумать...', '', 42010),
(14567, 'ruRU', 'Победите Халкиаса в Чертогах Покаяния в эпохальном режиме после того, как он вернет себе три своих фрагмента.', 'Время собирать камни', '', 42010),
(14533, 'ruRU', 'Победите Мордрету, Вечную императрицу, в Театре Боли в эпохальном режиме после того, как бросите /вызов и победите 2 призрачных претендентов.', 'Королевская битва', '', 42010),
(14503, 'ruRU', 'Победите ингру Малоха в туманах Тирна Скитта в эпохальном режиме после убийства разросшейся гидры.', 'Занимательная гидропоника', '', 42010),
(14417, 'ruRU', 'Победите Мордрету, Вечную императрицу в Театре Боли в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Театр Боли', '', 42010),
(14416, 'ruRU', 'Победите Мордрету, Вечную императрицу в Театре Боли в героическом или более сложном режиме.', 'Героический режим: Театр Боли', '', 42010),
(14415, 'ruRU', 'Победите маркграфиню Страдаму в Чумных каскадах в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Чумные каскады', '', 42010),
(14414, 'ruRU', 'Победите маркграфиню Страдаму в Чумных каскадах в героическом или более сложном режиме.', 'Героический режим: Чумные каскады', '', 42010),
(14413, 'ruRU', 'Победите Тред\'ову в туманах Тирна Скитта в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: туманы Тирна Скитта', '', 42010),
(14412, 'ruRU', 'Победите Тред\'ову в туманах Тирна Скитта в героическом или более сложном режиме.', 'Героический режим: туманы Тирна Скитта', '', 42010),
(14411, 'ruRU', 'Победите Лорд-камергера в Чертогах Покаяния в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Чертоги Покаяния', '', 42010),
(14410, 'ruRU', 'Победите Лорд-камергера в Чертогах Покаяния в героическом или более сложном режиме.', 'Героический режим: Чертоги Покаяния', '', 42010),
(14409, 'ruRU', 'Победите Мве\'залу на Той Стороне в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Та Сторона', '', 42010),
(14408, 'ruRU', 'Победите Мве\'залу на Той Стороне в героическом или более сложном режиме.', 'Героический режим: Та Сторона', '', 42010),
(14375, 'ruRU', 'Победите Тред\'ову в туманах Тирна Скитта в эпохальном режиме, после того как уничтожите разумного иглобрюха-поглотителя.', 'Жажда знаний', '', 42010),
(14374, 'ruRU', 'Победите Манаштормов на Той Стороне в эпохальном режиме, заставив Миллхауса и Миллифисент поразить друг друга \"Неистовством Тьмы\" и \"Сверхмощным лазером \"Два пальца\".', 'Семейная терапия', '', 42010),
(14373, 'ruRU', 'Победите Мве\'залу на Той Стороне.', 'Та Сторона', '', 42010),
(14372, 'ruRU', 'Победите Мордрету, Вечную императрицу, в Театре Боли.', 'Театр Боли', '', 42010),
(14371, 'ruRU', 'Победите Тред\'ову в туманах Тирна Скитта.', 'Туманы Тирна Скитта', '', 42010),
(14370, 'ruRU', 'Победите Лорд-камергера в Чертогах Покаяния.', 'Чертоги Покаяния', '', 42010),
(14369, 'ruRU', 'Победите маркграфиню Страдаму в Чумных каскадах.', 'Чумные каскады', '', 42010),
(14368, 'ruRU', 'Победите Налтора Криоманта на Смертельной тризне в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Смертельная тризна', '', 42010),
(14367, 'ruRU', 'Победите Налтора Криоманта на Смертельной тризне в героическом или более сложном режиме.', 'Героический режим: Смертельная тризна', '', 42010),
(14354, 'ruRU', 'Победите Хаккара, Манаштормов, дилера Зи\'ексу и Мве\'залу на Той Стороне в эпохальном режиме за один поход, пока хотя бы один участник группы поражен \"Порченой кровью\".', 'Острая инфекция', '', 42010),
(14352, 'ruRU', 'Победите Лорд-камергера в Чертогах Покаяния в эпохальном режиме, когда в углах зала находится 3 грехокаменные статуи.', 'Не загоняйте Денатрия в угол', '', 42010),
(14347, 'ruRU', 'Победите Склизгла в Чумных каскадах в эпохальном режиме, скормив ему три осклизлых лакомства.', 'Осклизлая пища', '', 42010),
(14331, 'ruRU', 'Победите \"Орифрион\" в Шпилях Перерождения в эпохальном режиме, активировав и уничтожив всех трех сломанных опустошителей.', 'Голиаф больше не на связи', '', 42010),
(14327, 'ruRU', 'Соберите все пять сфер в Шпилях Перерождения с интервалом не более 60 секунд после победы над Девией, идеалом Сомнения, в эпохальном режиме.', 'Отсюда виден мой дом', '', 42010),
(14326, 'ruRU', 'Победите Девию, идеала Сомнения, в Шпилях Перерождения.', 'Шпили Перерождения', '', 42010),
(14325, 'ruRU', 'Победите Девию, идеала Сомнения, в Шпилях Перерождения в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Шпили Перерождения', '', 42010),
(14324, 'ruRU', 'Победите Девию, идеала Сомнения, в Шпилях Перерождения в героическом или более сложном режиме.', 'Героический режим: Шпили Перерождения', '', 42010),
(14323, 'ruRU', 'Победите Девию, идеала Сомнения, поразив ее пятью копьями долга в Шпилях Перерождения в эпохальном режиме.', 'Накопление копий', '', 42010),
(14320, 'ruRU', 'Победите хирурга Трупошва на Смертельной тризне в эпохальном режиме, уничтожив две бочки с запасными частями.', 'Припасы хирурга', '', 42010),
(14297, 'ruRU', 'Победите каждого из противников в \"Оскорблении претендентов\" последним, несколько раз пройдя этот бой в Театре Боли в эпохальном режиме.', 'Выбираю всех трех', '', 42010),
(14296, 'ruRU', 'Победите доктора Икуса в Чумных каскадах в эпохальном режиме, уничтожив две нестабильные чумные бомбы.', 'Больше заразы', '', 42010),
(14295, 'ruRU', 'Победите Амарта Жнеца на Смертельной тризне в эпохальном режиме после того, как он поглотит труп мрачного колосса с помощью \"Последней жатвы\".', 'Обильная жатва', '', 42010),
(14292, 'ruRU', 'Победите всех боссов в Чумных каскадах в эпохальном режиме за один поход, пока на вас действует \"Чумной труп\".', 'Осклизлая вечеринка', '', 42010),
(14291, 'ruRU', 'Найдите 6 игрушек Призывательницы Туманов в туманах Тирна Скитта в эпохальном режиме.', 'Кто-то ведь мог споткнуться!', '', 42010),
(14290, 'ruRU', 'Победите Дараку Несокрушимого в Кровавых катакомбах в эпохальном режиме.', 'Я за тобой слежу', '', 42010),
(14289, 'ruRU', 'Победите генерала Кааль в Кровавых катакомбах в эпохальном режиме, находясь под действием эффекта \"Получай!\"', 'Каменная гостья', '', 42010),
(14286, 'ruRU', 'Победите вершителя Тарвольда, убив 8 подопытных с помощью эффектов \"Осадка\" в Кровавых катакомбах в эпохальном режиме.', 'Осадочек остался', '', 42010),
(14285, 'ruRU', 'Победите Налтора Криоманта в Смертельной тризне в эпохальном режиме или использовав эпохальный ключ, не получив урона от \"Кометной бури\" и \"Снежной бури\", а также избежав дополнительного эффекта \"Ледяных пут\".', 'К рейду готов VII', '', 42010),
(14284, 'ruRU', 'Победите Эшелона, разбив 18 или более неумирающих камнебесов за один раз в Чертогах Покаяния в эпохальном режиме.', 'Мышка пробежала, хвостиком махнула', '', 42010),
(14199, 'ruRU', 'Победите генерала Кааль в Кровавых катакомбах в эпохальном режиме или с помощью эпохального ключа.', 'Эпохальный режим: Кровавые катакомбы', '', 42010),
(14198, 'ruRU', 'Победите генерала Кааль в Кровавых катакомбах в героическом или более сложном режиме.', 'Героический режим: Кровавые катакомбы', '', 42010),
(14197, 'ruRU', 'Победите генерала Кааль в Кровавых катакомбах.', 'Кровавые катакомбы', '', 42010),
(15395, 'ruRU', '', 'Fae\'s Giving [DNT]', '', 42010),
(13930, 'ruRU', 'Соберите 200 искаженных временем знаков, выполняя задания и участвуя в боях в классической версии Альтеракской долины.', '\"А вот раньше на Альтераке...\"', 'Награда: рычун из клана Северного Волка', 42010),
(13928, 'ruRU', 'Соберите 200 искаженных временем знаков, выполняя задания и участвуя в боях в классической версии Альтеракской долины.', '\"А вот раньше на Альтераке...\"', 'Награда: боевой баран клана Грозовой Вершины', 42010),
(15388, 'ruRU', 'Исследуйте области Темных Земель.', 'Исследователь Темных Земель', '', 42010),
(14825, 'ruRU', 'Заработайте указанные ниже достижения в Темных Землях.', 'Треккер Темных Земель', '', 42010),
