(15403, 'zhCN', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'zhCN', '给塔扎维什，帷纱集市（史诗难度）的下列掮灵鼠挠痒痒。', '恶作剧！', '', 42010),
(15179, 'zhCN', '在受到消毒区域的影响时插入旁路代码，然后击败塔扎维什，帷纱集市的希尔布兰德（史诗难度）。', '红红火火', '', 42010),
(15178, 'zhCN', '在被发现使用伪造的凭证后，击败塔扎维什，帷纱集市的索·莉亚（史诗难度）。', '以假乱真', '坐骑奖励：塔扎维什齿轮滑翔器', 42010),
(15177, 'zhCN', '击败塔扎维什，帷纱集市的索·莉亚（史诗难度）。', '塔扎维什，帷纱集市', '', 42010),
(15109, 'zhCN', '被4种不同的搅碎的物质覆盖时，击败塔扎维什，帷纱集市的哨卫佐·菲克斯（史诗难度）。', '能搅碎吗？', '', 42010),
(15106, 'zhCN', '把所有不稳定的货物都在送货前交给至少一位其他玩家后，击败塔扎维什，帷纱集市的P.O.S.T.总管（史诗难度）。', '质检大关', '', 42010),
(14607, 'zhCN', '在伤逝剧场用软肉碎击把2块肉打软后击败斩血（史诗难度）。', '新鲜的肉！', '', 42010),
(14606, 'zhCN', '在彼界收集全部5个飘浮在商人赛·艾柯莎的上方的宝珠后击败她（史诗难度）。', '动动你的脑……', '', 42010),
(14567, 'zhCN', '在赎罪大厅的哈尔吉亚斯重新吸收了全部3个哈尔吉亚斯的碎片后击败他（史诗难度）。', '破镜重圆', '', 42010),
(14533, 'zhCN', '在伤逝剧场使用/challenge（/挑战）并击败两个幽魂参赛者后，击败无尽女皇莫德雷莎（史诗难度）。', '皇家大战', '', 42010),
(14503, 'zhCN', '在塞兹仙林的迷雾中，先击败长得过大的多头花，然后击败英格拉·马洛克（史诗难度）。', '无土栽培', '', 42010),
(14417, 'zhCN', '在伤逝剧场击败无尽女皇莫德蕾莎（史诗难度或史诗钥石难度）。', '伤逝剧场（史诗难度）', '', 42010),
(14416, 'zhCN', '在伤逝剧场击败无尽女皇莫德蕾莎（英雄或更高难度）。', '伤逝剧场（英雄难度）', '', 42010),
(14415, 'zhCN', '在凋魂之殇击败斯特拉达玛侯爵（史诗难度或史诗钥石难度）。', '凋魂之殇（史诗难度）', '', 42010),
(14414, 'zhCN', '在凋魂之殇击败斯特拉达玛侯爵（英雄或更高难度）。', '凋魂之殇（英雄难度）', '', 42010),
(14413, 'zhCN', '在塞兹仙林的迷雾击败特雷德奥瓦（史诗难度或史诗钥石难度）。', '塞兹仙林的迷雾（史诗难度）', '', 42010),
(14412, 'zhCN', '在塞兹仙林的迷雾击败特雷德奥瓦（英雄或更高难度）。', '塞兹仙林的迷雾（英雄难度）', '', 42010),
(14411, 'zhCN', '在赎罪大厅击败宫务大臣。（史诗难度或史诗钥石难度）。', '赎罪大厅（史诗难度）', '', 42010),
(14410, 'zhCN', '在赎罪大厅击败宫务大臣（英雄或更高难度）。', '赎罪大厅（英雄难度）', '', 42010),
(14409, 'zhCN', '在彼界击败穆厄扎拉（史诗难度或史诗钥石难度）。', '彼界（史诗难度）', '', 42010),
(14408, 'zhCN', '在彼界击败穆厄扎拉（英雄或更高难度）。', '彼界（英雄难度）', '', 42010),
(14375, 'zhCN', '在塞兹仙林的迷雾中先击败觉醒的锥喉饕餮者，然后击败特雷德奥瓦。', '求知若渴', '', 42010),
(14374, 'zhCN', '在彼界中，使米尔豪斯和米尔菲丝用各自的暗影之怒和反射手指型激光发射器究极版互相攻击，然后将他们击败（史诗难度）。', '伴侣咨询', '', 42010),
(14373, 'zhCN', '在彼界击败穆厄扎拉。', '彼界', '', 42010),
(14372, 'zhCN', '在伤逝剧场击败无尽女皇莫德蕾莎。', '伤逝剧场', '', 42010),
(14371, 'zhCN', '在塞兹仙林的迷雾击败特雷德奥瓦。', '塞兹仙林的迷雾', '', 42010),
(14370, 'zhCN', '在赎罪大厅击败宫务大臣。', '赎罪大厅', '', 42010),
(14369, 'zhCN', '在凋魂之殇击败斯特拉达玛侯爵。', '凋魂之殇', '', 42010),
(14368, 'zhCN', '在通灵战潮击败缚霜者纳尔佐（史诗难度或史诗钥石难度）。', '通灵战潮（史诗难度）', '', 42010),
(14367, 'zhCN', '在通灵战潮击败缚霜者纳尔佐（英雄或更高难度）。', '通灵战潮（英雄难度）', '', 42010),
(14354, 'zhCN', '在同一次游历中，在至少一位队伍成员带有堕落之血效果的情况下，击败彼界的哈卡、法力风暴夫妇、商人赛·艾柯莎和穆厄扎拉（史诗难度）。', '传染性极强', '', 42010),
(14352, 'zhCN', '在赎罪大厅中，在3座罪碑雕像都位于房间角落时击败宫务大臣（史诗难度）。', '你胆敢把德纳修斯冷落在角落里', '', 42010),
(14347, 'zhCN', '在凋魂之殇中，先将三道菜喂给酤团，然后再将其击败（史诗难度）。', '全血宴', '', 42010),
(14331, 'zhCN', '在晋升高塔中，先激活并摧毁全部三个破碎的毁灭者，然后消灭奥莱芙莉安（史诗难度）。', '哥利亚离线', '', 42010),
(14327, 'zhCN', '在晋升高塔中，击败疑虑圣杰德沃丝后，收集全部五颗宝珠，且每两次收集的间隔不超过60秒（史诗难度）。', '我可以从这里看到我的家', '', 42010),
(14326, 'zhCN', '在晋升高塔击败疑虑圣杰德沃丝。', '晋升高塔', '', 42010),
(14325, 'zhCN', '在晋升高塔击败疑虑圣杰德沃丝（史诗难度或史诗钥石难度）。', '晋升高塔（史诗难度）', '', 42010),
(14324, 'zhCN', '在晋升高塔击败疑虑圣杰德沃丝（英雄或更高难度）。', '晋升高塔（英雄难度）', '', 42010),
(14323, 'zhCN', '在晋升高塔使用五根使命之矛击中疑虑圣杰德沃丝后再击败她（史诗难度）。', '老练矛手', '', 42010),
(14320, 'zhCN', '在通灵战潮中，先摧毁两桶备用部件，然后击败外科医生缝肉（史诗难度）。', '外科耗材', '', 42010),
(14297, 'zhCN', '在伤逝剧场中，在多次完成狭路相逢战斗的过程中最后击败每一位斗士（史诗难度）。', '三选一', '', 42010),
(14296, 'zhCN', '在凋魂之殇中，先摧毁2颗易爆魔药炸弹，然后击败伊库斯博士（史诗难度）。', '这下你火啦！', '', 42010),
(14295, 'zhCN', '在通灵战潮中，在收割者阿玛厄斯用最终收割吞噬了一具恐怖巨像的尸体后将其击败（史诗难度）。', '大丰收', '', 42010),
(14292, 'zhCN', '在对凋魂之殇的同一次游历中，在受到凋殇者效果影响期间击败所有首领（史诗难度）。', '软泥骑行', '', 42010),
(14291, 'zhCN', '在塞兹仙林的迷雾找到唤雾者的6个玩具（史诗难度）。', '有人踩到怎么办！', '', 42010),
(14290, 'zhCN', '击败赤红深渊的坚不可摧的杜拉卡（史诗难度）。', '我的眼里只有你', '', 42010),
(14289, 'zhCN', '在赤红深渊中，受到爆扣！效果影响期间击败卡尔将军（史诗难度）。', '卡尔大灌篮', '', 42010),
(14286, 'zhCN', '在赤红深渊中，用残渣效果消灭8名被遗忘的俘虏，然后击败执行者塔沃德（史诗难度）。', '残灵古堡', '', 42010),
(14285, 'zhCN', '在通灵战潮中，躲开彗星风暴、暴风雪或冻结之缚的次要效果，并击败缚霜者纳尔佐（史诗难度）。', '准备突袭第七季', '', 42010),
(14284, 'zhCN', '在赎罪大厅中，一次性击碎18个或更多的不死石精，然后击败艾谢朗（史诗难度）。', '绝命石师', '', 42010),
(14199, 'zhCN', '在赤红深渊击败卡尔将军（史诗难度或史诗钥石难度）。', '赤红深渊（史诗难度）', '', 42010),
(14198, 'zhCN', '在赤红深渊击败卡尔将军（英雄或更高难度）。', '赤红深渊（英雄难度）', '', 42010),
(14197, 'zhCN', '在赤红深渊击败卡尔将军。', '赤红深渊', '', 42010),
(15395, 'zhCN', '', 'Fae\'s Giving [DNT]', '', 42010),
(13930, 'zhCN', '通过参与奥特兰克山谷（经典）的战斗和完成任务获取200枚时空扭曲徽章。', '奥特兰克山谷的旧恨新仇', '奖励：霜狼咆哮者', 42010),
(13928, 'zhCN', '通过参与奥特兰克山谷（经典）的战斗和完成任务获取200枚时空扭曲徽章。', '奥特兰克山谷的旧恨新仇', '奖励：雷矛军用山羊', 42010),
(15388, 'zhCN', '探索暗影界的各个区域。', '暗影界探索者', '', 42010),
(14825, 'zhCN', '完成下列暗影界成就。', '暗影界旅行家', '', 42010),
(14802, 'zhCN', '在伤逝剧场中击败全部7名勇士。', '铁血搏击', '', 42010),
(14791, 'zhCN', '在与沼泽博格特战斗途中或者战斗之后，向格文瑟伊尔投掷一枚散发微光的种子。', '给你的猎人一枚种子……', '', 42010),
(14788, 'zhCN', '在炽蓝仙野归还下列失落的书籍。', '破碎的妖精传说', '', 42010),
(14779, 'zhCN', '消灭下列炽蓝仙野的野兽。', '荒野狩猎', '', 42010),
(14774, 'zhCN', '品尝每一种炽蓝仙野的美味。', '炽蓝仙野食神', '', 42010),
(14771, 'zhCN', '骑乘下列雷文德斯的马车。', '冥世快车', '', 42010),
(14770, 'zhCN', '租赁城堡罪奔者来载你前往下列每一个雷文德斯的地点。', '暗影骑行', '', 42010),
(14769, 'zhCN', '用注能红宝石使雷文德斯的每尊恐惧蝠雕像活化。', '有蝙蝠！', '', 42010),
(14768, 'zhCN', '获得晋升堡垒的下列所有赞美诗的效果。', '这是什么旋律？', '', 42010),
(14767, 'zhCN', '获得晋升堡垒的下列所有净化祝福的效果。', '知足常乐', '', 42010),
