INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(15403, 'zhTW', '', '[DNT] <Hidden> Mythic+ Rating > 0 (Shadowlands, S2 or later)', '', 42010),
(15190, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中對下列仲介者老鼠搔癢。', '調皮搗蛋！', '', 42010),
(15179, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中，只有在受到淨化力場的情況下才輸入旁路代碼，並擊敗海布藍德。', '別擔心，我沒事', '', 42010),
(15178, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中，被逮到使用偽造證件之後擊敗索利亞。', '弄假成真', '坐騎獎勵：塔札維許滑行器', 42010),
(15177, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中擊敗索利亞。', '『帷幕市集』塔札維許', '', 42010),
(15109, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中，在被4種不同混合物質包覆時，擊敗哨兵佐菲克斯。', '這能打碎嗎？', '', 42010),
(15106, 'zhTW', '在傳奇難度的『帷幕市集』塔札維許中，將所有不穩定的貨物傳給至少一個其他玩家，然後再擊敗郵務主管。', '品質控制', '', 42010),
(14607, 'zhTW', '在傳奇難度的苦痛劇場中，在以搗肉猛擊拍軟兩塊肉後擊敗肉排。', '新鮮的肉！', '', 42010),
(14606, 'zhTW', '在傳奇難度的彼界境地中，在收集漂浮在商人希夏上方的全部5個寶珠後擊敗她。', '珠聯璧合', '', 42010),
(14567, 'zhTW', '在傳奇難度的贖罪之殿中，在哈奇厄斯吸收全部三個哈奇厄斯裂片後擊敗他。', '撿起碎片', '', 42010),
(14533, 'zhTW', '在傳奇難度的苦痛劇場中，在進行挑戰並擊敗2個鬼魅爭奪者後擊敗『不朽女皇』莫瑞莎。', '皇家大混戰', '', 42010),
(14503, 'zhTW', '在傳奇難度的特那希迷霧中，在擊敗一隻巨大的多頭樹妖後擊敗英拉馬洛克。', '水蛇上鉤', '', 42010),
(14417, 'zhTW', '在傳奇或傳奇鑰石難度的苦痛劇場中，擊敗『不朽女皇』莫瑞莎。', '傳奇：苦痛劇場', '', 42010),
(14416, 'zhTW', '在英雄或更高難度的苦痛劇場中，擊敗『不朽女皇』莫瑞莎。', '英雄：苦痛劇場', '', 42010),
(14415, 'zhTW', '在傳奇或傳奇鑰石難度的瘟疫之臨中，擊敗藩侯史特拉達瑪。', '傳奇：瘟疫之臨', '', 42010),
(14414, 'zhTW', '在英雄或更高難度的瘟疫之臨中，擊敗藩侯史特拉達瑪。', '英雄：瘟疫之臨', '', 42010),
(14413, 'zhTW', '在傳奇或傳奇鑰石難度的特那希迷霧中，擊敗崔朵瓦。', '傳奇：特那希迷霧', '', 42010),
(14412, 'zhTW', '在英雄或更高難度的特那希迷霧中，擊敗崔朵瓦。', '英雄：特那希迷霧', '', 42010),
(14411, 'zhTW', '在傳奇或傳奇鑰石難度的贖罪之殿中，擊敗宮務大臣。', '傳奇：贖罪之殿', '', 42010),
(14410, 'zhTW', '在英雄或更高難度的贖罪之殿中，擊敗宮務大臣。', '英雄：贖罪之殿', '', 42010),
(14409, 'zhTW', '在傳奇或傳奇鑰石難度的彼界境地中，擊敗繆薩拉。', '傳奇：彼界境地', '', 42010),
(14408, 'zhTW', '在英雄或更高難度的彼界境地中，擊敗繆薩拉。', '英雄：彼界境地', '', 42010),
(14375, 'zhTW', '在傳奇難度的特那希迷霧中，在擊敗受啟發的脊喉吞食者後擊敗崔朵瓦。', '求知若渴', '', 42010),
(14374, 'zhTW', '在傳奇難度中，於彼界境地使米歐浩斯和米歐菲瑟以每次施放的暗影之怒和回音指尖極限雷射互相攻擊，然後擊敗他們。', '伴侶諮商', '', 42010),
(14373, 'zhTW', '到彼界境地擊敗繆薩拉。', '彼界境地', '', 42010),
(14372, 'zhTW', '在苦痛劇場擊敗『不朽女皇』莫瑞莎。', '苦痛劇場', '', 42010),
(14371, 'zhTW', '到特那希迷霧擊敗崔朵瓦。', '特那希迷霧', '', 42010),
(14370, 'zhTW', '在贖罪之殿擊敗宮務大臣。', '贖罪之殿', '', 42010),
(14369, 'zhTW', '到瘟疫之臨擊敗藩侯史特拉達瑪。', '瘟疫之臨', '', 42010),
(14368, 'zhTW', '在傳奇難度或傳奇鑰石難度中，於死靈戰地擊敗『霜縛者』納爾索。', '傳奇難度：死靈戰地', '', 42010),
(14367, 'zhTW', '在英雄或更高的難度中，於死靈戰地擊敗『霜縛者』納爾索。', '英雄：死靈戰地', '', 42010),
(14354, 'zhTW', '在傳奇難度的彼界境地一次行動中，於至少有一名隊伍成員受到腐化之血感染時，擊敗哈卡、曼納斯頓夫婦、商人希夏和繆薩拉。', '極易傳染', '', 42010),
(14352, 'zhTW', '在傳奇難度的贖罪之殿中，以房間角落的3座罪孽石雕像擊敗宮務大臣。', '沒人能威脅戴納瑟斯', '', 42010),
(14347, 'zhTW', '在傳奇難度的瘟疫之臨中，在餵食葛洛格羅三道菜組成的套餐後擊敗他。', '斷頭飯', '', 42010),
(14331, 'zhTW', '在傳奇難度的晉升之巔中，啟動並摧毀全部三個破碎毀滅者，然後殺死奧利菲翁。', '巨人離線', '', 42010),
(14327, 'zhTW', '在傳奇難度的晉升之巔中，在擊敗『猜疑楷模』德沃絲後，相隔60秒以內收集全部五個寶珠。', '我可以從這裡看到我家', '', 42010),
(14326, 'zhTW', '擊敗晉升之巔的『猜疑楷模』德沃絲。', '晉升之巔', '', 42010),
(14325, 'zhTW', '在傳奇或傳奇鑰石難度中，擊敗晉升之巔的『猜疑楷模』德沃絲。', '傳奇難度：晉升之巔', '', 42010),
(14324, 'zhTW', '在英雄或更高的難度中，擊敗晉升之巔的『猜疑楷模』德沃絲。', '英雄：晉升之巔', '', 42010),
(14323, 'zhTW', '在傳奇難度的晉升之巔中，以五根重責之矛擊中『猜疑楷模』德沃絲之後擊敗她。', '長矛專家', '', 42010),
(14320, 'zhTW', '在傳奇難度的死靈戰地中，先破壞兩桶備用零件，再擊敗縫補師縫肉。', '縫補師的補給品', '', 42010),
(14297, 'zhTW', '在傳奇難度的苦痛劇場中，透過多次完成蔑視挑戰者會戰並擊敗每一位倖存的戰鬥員。', '三選一', '', 42010),
(14296, 'zhTW', '在傳奇難度的瘟疫之臨中，摧毀2枚爆燃瘟疫彈後，再擊敗伊克思博士。', '一舉爆紅', '', 42010),
(14295, 'zhTW', '在傳奇難度的死靈戰地中，於『收割者』亞瑪斯使用最終收割吞噬恐怖巨人的屍體後擊敗他。', '豐碩收割', '', 42010),
(14292, 'zhTW', '在傳奇難度的瘟疫之臨一次行動中，於受到瘟疫亡者的影響時擊敗所有首領。', '與軟泥一起馳騁', '', 42010),
(14291, 'zhTW', '在傳奇難度的特那希迷霧找到喚霧者的6個玩具。', '玩完記得要收好！', '', 42010),
(14290, 'zhTW', '在傳奇難度的血紅深淵擊敗無敵的杜拉卡。', '我的眼中只有你', '', 42010),
(14289, 'zhTW', '在傳奇難度的血紅深淵中，於受到「遭受猛擊！」的影響時擊敗凱厄將軍。', '厄運當頭', '', 42010),
(14286, 'zhTW', '在傳奇難度中，在受到殘渣效果影響下殺死8個荒棄俘虜後再擊敗血紅深淵的處決者塔沃德。', '殘渣刑魔', '', 42010),
(14285, 'zhTW', '在傳奇難度中，在沒被彗星風暴、暴風雪或冰凍束縛的次要效果擊中的情況下，擊敗死靈戰地的『霜縛者』納爾索。', '準備好出副本之七', '', 42010),
(14284, 'zhTW', '在傳奇難度中，於贖罪之殿一次粉碎18個以上的不死石魔後，擊敗艾可隆。', '破除邪惡', '', 42010),
(14199, 'zhTW', '在傳奇或傳奇鑰石難度的血紅深淵中，擊敗凱厄將軍。', '傳奇：血紅深淵', '', 42010),
(14198, 'zhTW', '在英雄或更高難度的血紅深淵中擊敗凱厄將軍。', '英雄：血紅深淵', '', 42010),
(14197, 'zhTW', '在血紅深淵擊敗凱厄將軍。', '血紅深淵', '', 42010),
(15395, 'zhTW', '', 'Fae\'s Giving [DNT]', '', 42010),
(13930, 'zhTW', '從任務和參加經典奧特蘭克山谷獲得200個時光扭曲徽章。', '懷舊奧特蘭克山谷', '獎勵：霜狼咆哮者', 42010),
(13928, 'zhTW', '從任務和參加經典奧特蘭克山谷獲得200個時光扭曲徽章。', '懷舊奧特蘭克山谷', '獎勵：雷矛戰鬥山羊', 42010),
(15388, 'zhTW', '探索暗影之境所有區域。', '暗影之境探險家', '', 42010),
(14825, 'zhTW', '完成下列的暗影之境成就。', '暗影之境旅人', '', 42010),
(14802, 'zhTW', '到苦痛劇場擊敗全部七個勇士。', '浴血奮戰', '', 42010),
(14791, 'zhTW', '在與沼澤邪靈戰鬥期間或之後，朝『冬狼』葛溫希爾投擲微微發光的種子。', '賞你的獵人一點種子…', '', 42010),
